import React from "react";
import { connect } from "react-redux";
import classNames from "classnames";
import { setActiveComponent, restart } from "../actions";
import Histogram from "./Histogram";

class Result extends React.Component {
  constructor(props) {
    super(props);
    this.ths = [];
    this.props.attributes.forEach(([attr, config]) => {
      if (this.props.mask[attr]) {
        const th = <th key={attr}>{attr}</th>;
        this.ths.push(th);
      }
    });
    this.ths.push(<th key="chooseCheckbox"/>);

    this.trs = this.props.leftPoints.map((idx, i) => (
        <tr key={i} data-toggle="tooltip" title={this.props.labels[idx]}>
          {this.props.candidates[idx].map((x, j) => (
              <td key={j}>{x}</td>
          ))}
          <td key="chooseCheckbox"/>
        </tr>
    ));

    const sss = this.props.scores.map((sid, i) => (
        <tr key={i} data-toggle="tooltip" title={this.props.labels[i]}>
          <td key={i}>{sid}</td>
        </tr>
    ));

    //top-1 points
    const top1 = [];
    top1.push(this.trs[0]);
    //obtain the index
    const top1small = [];
    const top1large = [];
    for (let i = 1; i < this.props.leftPoints.length; ++i) {
      if ((this.props.scores[0] - this.props.scores[i]) / this.props.scores[0] < 0.1)
        top1small.push(this.props.leftPoints[i]);
      else
        top1large.push(this.props.leftPoints[i]);
    }

    const top1smallSample = this.pickRandom(top1small, 5);
    const top1largeSample = this.pickRandom(top1large, 5);
    for (let i = 0; i < top1largeSample.length; ++i)
      top1smallSample.push(top1largeSample[i]);
    const top1Samplewithbox = top1smallSample.map((idx, i) => (
        <tr key={i} data-toggle="tooltip" title={this.props.labels[idx]}>
          {this.props.candidates[idx].map((x, j) => (
              <td key={j}>{x}</td>
          ))}
          <td>
            <input type="checkbox" id={`myCheckbox${i}`} name={`myCheckbox${i}`} value="myValue"/>
            <label htmlFor={`myCheckbox${i}`}> Prefer </label>
          </td>
        </tr>
    ));
    this.state = {
      intro: "Here is your favorite car.",
      inst: "Please compare your favorite car and the following cars <br/> and indicate if you are interested in the following cars?",
      ths: this.ths,
      top: top1,
      topSamplewithbox: top1Samplewithbox
    };
  }

  pickRandom = (arr, n) => {
    const arrCopy = [...arr];
    if (arrCopy.length <= n)
      return arrCopy;
    // Shuffle array
    for (let i = arrCopy.length - 1; i > 0; i--) {
      const j = Math.floor(Math.random() * (i + 1));
      [arrCopy[i], arrCopy[j]] = [arrCopy[j], arrCopy[i]]; // ES6 array element swap
    }
    return arrCopy.slice(0, n);
  };

  downloadFile = index => {
    if (index === 1) {
      this.setState({
        intro: "Here are your top-5 favorite cars.",
        inst: "Please compare your favorite top-5 cars and the following cars <br/> and indicate if you are interested in the following cars?"
      });
    }
    else {
      let data = "This is sample text for our file";

      let blob = new Blob([data], {type: 'text/plain'});
      let url = URL.createObjectURL(blob);
      let downloadLink = document.createElement('a');
      downloadLink.href = url;
      downloadLink.download = 'sample.txt'; // 指定下载文件及类型
      document.body.appendChild(downloadLink);
      downloadLink.click();
      document.body.removeChild(downloadLink);
    }
  };

  render() {
    return (
        <div>
          <div className="justify-content-center">
            <h4>{this.state.intro}</h4>
            <table className={classNames("table", "table-hover", {
                     "table-fixed": this.trs.length > 7
                   })}
                   style={{
                     maxWidth: "40rem",
                     margin: "auto"
                   }}>
              <thead>
              <tr>{this.ths}</tr>
              </thead>
              <tbody>{this.state.top}</tbody>
            </table>
            <h5>{this.state.inst}</h5>
            <table
                className={classNames("table", "table-hover", {
                  "table-fixed": this.trs.length > 7
                })}
                style={{
                  maxWidth: "40rem",
                  margin: "auto"
                }}
            >
              <thead>
              <tr>{this.ths}</tr>
              </thead>
              <tbody>{this.state.topSamplewithbox}</tbody>
            </table>
            <br></br>
            <div>
              <button
                  type="button"
                  className="btn btn-primary"
                  style={{width: "8rem"}}
                  onClick={() => this.downloadFile(1)}>
                Finish
              </button>
            </div>
          </div>
        </div>
    );
  }
}

const mapStateToProps = ({
  labels,
  candidates,
  leftPoints,
  attributes,
  mask,
  numLeftPoints,
  scores
}) => ({
  labels,
  candidates,
  leftPoints,
  attributes,
  mask,
  numLeftPoints,
  scores
});

const mapDispatchToProps = dispatch => ({
  restart: () => {
    dispatch(setActiveComponent("Welcome"));
    dispatch(restart());
  }
});

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(Result);
